import React from "react";
import { Row, Col } from "antd";
import Menu from "../Molecules/Menu/Menu";
import Logo from "../Atoms/Logo/Logo";
import Vip from "../Atoms/Vip/Vip";
import "./style.css";
import 'antd/dist/antd.css';
import Header from "../Molecules/Header/Header";
import Content from "../Molecules/Content/Content"
import ListLibrary from "../Molecules/library/ListLibrary";
class HomePage extends React.Component {
  state = {
    list1: [
    {
      id: 1,
      title: "Cá Nhân",
      icon: "music"
    },
    {
      id: 2,
      title: "Khám Phá",
      icon: "dot-circle"
    },
    {
      id: 3,
      title: "#zingchart",
      icon: "chart-line"
    },
    {
      id: 4,
      title: "Radio",
      icon: "headphones"
    },
    {
      id: 5,
      title: "Theo dõi",
      icon: "list"
    }]
    ,
    list2:[
    {
      id: 1,
      title: "Nhạc Mới",
      icon: "microphone"
    },
    {
      id: 2,
      title: "Thể Loại",
      icon: "icons"
    },
    {
      id: 3,
      title: "Top 100",
      icon: "star-half-alt"
    },
    {
      id: 4,
      title: "MV",
      icon: "guitar"
    }
    ],
    list3:[
      {
        id: 1,
        title: "Bài hát",
        icon: "https://zjs.zadn.vn/zmp3-desktop/releases/v1.0.13/static/media/my-song.cf0cb0b4.svg"
      },
      {
        id: 2,
        title: "Playlist",
        icon: "https://zjs.zadn.vn/zmp3-desktop/releases/v1.0.13/static/media/my-playlist.7e92a5f0.svg"
      },
      {
        id: 3,
        title: "Gần đây",
        icon: "https://zjs.zadn.vn/zmp3-desktop/releases/v1.0.13/static/media/my-history.374cb625.svg"
      }
    ]
  };
  render() {
    return (
      <>
        <Row>
          <Col className="left-content" span={4}>
            <Logo/>
            <Menu list={this.state.list1}/>
            <div>
              <Menu list={this.state.list2}/>
              <Vip/>
            </div>
            <ListLibrary list={this.state.list3}/>
          </Col>
          <Col className="right-content" span={20}>
            <Header/>
            <Row>
              <Col span={12} offset={6}>
                col-12 col-offset-6
              </Col>
            </Row>
            <Content/>
          </Col>
        </Row>
      </>
    );
  }
}

export default HomePage;
